const MobilePanel = () => {

    return(
        <div className='block sm:hidden'>
            <div className="w-full h-[60px] bg-[#303030] rounded-b-3xl"> <div className='h-full flex justify-center items-center'><a className='inter text-white ' href="">Last 100 Quakes</a><div className='w-14'></div><a className='inter text-[#909090]' href="">Last 100 Quakes</a></div></div>
            <div className="w-full z-10 h-[110px] mt-10 bg-[#303030] rounded-t-3xl"> 
                <div className='flex justify-center top-0 h-[85%] items-center w-full'>
                <select className='text-[#D2D2D2] text-[12pt] bg-[#202020] rounded-lg inter-light p-2'><option>Lastest First</option></select>
                <div className='w-10'/>
                <select className='text-[#D2D2D2] text-[12pt] bg-[#202020] rounded-lg inter-light p-2'><option >This Week</option></select>
                </div>
                <div className="fixed bottom-0 bg-[#303030]"></div>
            </div>
        </div>
    );
}
export default MobilePanel;
